import React from "react";

const SlideList01 = ({ title, children, hasMore, onMoreClick }) => {
  return (
    <div className="container nopadding">
      <h5>{title}</h5>
      <div className="slideList">
        <ul className="listWrap">
          {children}

          {hasMore && (
            <li className="item more">
              <a onClick={onMoreClick} className="moreLink">
                <div className="inner">
                  <span>더보기</span>
                </div>
              </a>
            </li>
          )}
        </ul>
      </div>
    </div>
  );
};

export default SlideList01;
